import { Injectable } from '@angular/core';
import { Init } from './init-tasks';

@Injectable({
  providedIn: 'root'
})

export class TasksService {

  constructor() { }

  getTasks() {
    let tasks = JSON.parse(localStorage.getItem('tasks'));
    return tasks;
  }
}
